  const data = [
    { id: 1, name: 'Item 1' },
    { id: 2, name: 'Item 2' },
    { id: 3, name: 'Item 3' },
  ];
  res.json(data);
});
```
5. Set up the scripts:

In the `package.json` file in the root directory of your project, add the following scripts:
```json
"scripts": {
  "start": "node server.js",
  "server": "nodemon server.js",
  "client": "npm start --prefix client",
  "dev": "concurrently \"npm run server\" \"npm run client\""
}
```
6. Run the application:

Start the development server by running the following command:
```
npm run dev
```
7. Deploy the application:

To deploy the application, you can use a service like Heroku. First, create a new Heroku app:
```
heroku create
```
Then, add the Heroku Postbuild script to the `package.json` file in the root directory of your project:
```json
"scripts": {
  "heroku-postbuild": "NPM_CONFIG_PRODUCTION=false npm install --prefix client && npm run build --prefix client"
}
```
Finally, deploy the application to Heroku:
```
git push heroku master
```

