Here is a sample Spark job that calculates the hit rate for onsite attributed data:
```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.sql.SparkSession
import scala.collection.mutable.Map

object HitRateCalculator {
  def main(args: Array[String]): Unit = {
    val spark = SparkSession.builder()
      .appName("HitRateCalculator")
      .master("local[*]")
      .getOrCreate()

    // Load onsite attributed data
    val onsiteData: JavaRDD[String] = spark.read()
      .textFile("onsite_data.txt")
      .javaRDD()

    // Load top frequent queries
    val topQueries: JavaRDD[String] = spark.read()
      .textFile("top_queries.txt")
      .javaRDD()

    // Broadcast top frequent queries
    val topQueriesBroadcast: Broadcast[Array[String]] = spark.sparkContext.broadcast(topQueries.collect())

    // Initialize cache
    val cache: Map[String, Long] = Map()

    // Process onsite attributed data
    val hitRate = onsiteData.map(new Function[String, (Boolean, Long)] {
      override def call(line: String): (Boolean, Long) = {
        val Array(query, timestamp) = line.split(" ")

        // Check if query is in top frequent queries
        if (topQueriesBroadcast.value.contains(query)) {
          // Check if query is in cache
          if (cache.contains(query)) {
            // Check if query is still in cache
            if (cache(query) > timestamp.toLong) {
              // Cache hit
              (true, 1)
            } else {
              // Cache miss, update cache
              cache.put(query, timestamp.toLong + 12 * 60 * 60 * 1000)
              (false, 1)
            }
          } else {
            // Cache miss, add to cache
            cache.put(query, timestamp.toLong + 12 * 60 * 60 * 1000)
            (false, 1)
          }
        } else {
          // Query not in top frequent queries, ignore
          (false, 0)
        }
      }
    }).reduce((a, b) => (a._1 || b._1, a._2 + b._2))

    // Calculate hit rate
    val hitRateValue = hitRate._1 match {
      case true => hitRate._2.toDouble / onsiteData.count()
      case false => 0.0
    }

    println(s"Hit rate: $hitRateValue")

    spark.stop()
  }
}
```
This job first loads the onsite attributed data and top frequent queries from text files. It then broadcasts the top frequent queries to all nodes in the cluster. It initializes an empty cache to store the queries and their expiration times.

The job then processes each line in the onsite attributed data. If the query is in the top frequent queries, it checks if it is in the cache. If it is, it checks if it is still in the cache. If it is, it is a cache hit. If it is not, it is a cache miss and the query is added to the cache with an expiration time of 12 hours. If the query is not in the cache, it is a cache miss and the query is added to the cache with an expiration time of 12 hours.

The job then calculates the hit rate by dividing the number of cache hits by the total number of queries in the onsite attributed data.

