To create a tooltip in NextJS using React Context to close the previously opened tooltip, you can follow these steps:

1. Create a Tooltip Context:

First, create a context for the tooltip component. This context will be used to manage the state of the tooltip and provide a way to close the previously opened tooltip.

```jsx
import React from 'react';

const TooltipContext = React.createContext();

export default TooltipContext;
```

2. Create a Tooltip Provider:

Next, create a provider component that will wrap the tooltip components and provide the context to them. This provider will manage the state of the tooltip and provide a function to close the previously opened tooltip.

```jsx
import React, { useState } from 'react';
import TooltipContext from './TooltipContext';

const TooltipProvider = ({ children }) => {
  const [activeTooltip, setActiveTooltip] = useState(null);

  const closeTooltip = () => {
    setActiveTooltip(null);
  };

  return (
    <TooltipContext.Provider value={{ activeTooltip, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export default TooltipProvider;
```

3. Create a Tooltip Component:

Now, create a tooltip component that will use the context to manage its state and close the previously opened tooltip.

```jsx
import React, { useContext } from 'react';
import TooltipContext from './TooltipContext';

const Tooltip = ({ children, content }) => {
  const { activeTooltip, closeTooltip } = useContext(TooltipContext);

  const handleMouseEnter = () => {
    closeTooltip();
  };

  const handleMouseLeave = () => {
    setTimeout(() => {
      if (activeTooltip === content) {
        closeTooltip();
      }
    }, 100);
  };

  return (
    <div
      onMouseEnter={handleMouseEnter}
      onMouseLeave={handleMouseLeave}
    >
      {children}
      {activeTooltip === content && (
        <div className="tooltip">{content}</div>
      )}
    </div>
  );
};

export default Tooltip;
```

4. Use the Tooltip Component:

Finally, use the tooltip component in your NextJS application by wrapping it with the tooltip provider.

```jsx
import React from 'react';
import TooltipProvider from './TooltipProvider';
import Tooltip from './Tooltip';

const App = () => {
  return (
    <TooltipProvider>
      <div>
        <Tooltip content="Tooltip 1">Hover me 1</Tooltip>
        <Tooltip content="Tooltip 2">Hover me 2</Tooltip>
        <Tooltip content="Tooltip 3">Hover me 3</Tooltip>
      </div>
    </TooltipProvider>
  );
};

export default App;
```

In this example, the `TooltipProvider` component wraps the `Tooltip` components and provides the context to them. The `Tooltip` component uses the context to manage its state and close the previously opened tooltip. When a tooltip is hovered, it will close the previously opened tooltip and show its own tooltip. When the mouse leaves the tooltip, it will close itself after a short delay.

