Here are the JavaScript functions to pack and unpack an array of entities to an ArrayBuffer:

```javascript
function packEntities(entities) {
  const bufferSize = Math.ceil(entities.length * 1 / 8) * 8; // Ensure the buffer size is a multiple of 8
  const buffer = new ArrayBuffer(bufferSize);
  const view = new DataView(buffer);

  let offset = 0;
  for (let i = 0; i < entities.length; i++) {
    const id = entities[i].id & 0xF; // 4 bits
    const size = entities[i].size & 0x7; // 3 bits

    view.setUint8(offset, (id << 4) | size, true);
    offset += 1;
  }

  return buffer;
}

function unpackEntities(buffer) {
  const view = new DataView(buffer);
  const entities = [];

  let offset = 0;
  while (offset < view.byteLength) {
    const value = view.getUint8(offset, true);
    const id = (value >> 4) & 0xF;
    const size = value & 0x7;

    entities.push({ id, size });
    offset += 1;
  }

  return entities;
}
```

These functions assume that the `entities` array is an array of objects with `id` and `size` properties. The `packEntities` function creates an ArrayBuffer with a size that is a multiple of 8, and then iterates through the entities, packing the `id` and `size` fields into a single byte using bitwise operations. The `unpackEntities` function does the reverse, iterating through the ArrayBuffer and extracting the `id` and `size` fields from each byte.

